import React, { FC, memo } from 'react';
import Navigation from '../Navigation/Navigation';
import './Sidebar.scss';

const Sidebar: FC = () => {
  return (
    <aside className='sidebar'>
      <div>Anton Stanev</div>
      <p>Senior Front</p>
      <Navigation />
    </aside>
  );
};

export default memo(Sidebar);
